import React, { useEffect } from "react";
import axios from "axios";


function Axios1()
{
    useEffect(
        ()=>{axios.get("https://jsonplaceholder.typicode.com/posts").then((res)=>{console.log(res)})},[]
    )
}

export default Axios1;
